B.wj=new A.a_("\u2705 1. Obtener la Residencia Legal en Panam\xe1\n La residencia fiscal est\xe1 usualmente vinculada a la residencia legal.\nPara obtenerla, debes aplicar a una de las siguientes categor\xedas migratorias:\n\nPrincipales categor\xedas:\n\n- Residencia por el Tratado de Amistad con pa\xedses amigos (si aplicas).\n- Residencia por solvencia econ\xf3mica (inversi\xf3n en bienes ra\xedces o dep\xf3sito a plazo).\n- Residencia por razones laborales (empleo con empresa establecida en Panam\xe1).\n- Residencia como pensionado o jubilado.\n\n\u26a0\ufe0f Cada tipo de visa tiene requisitos distintos. Generalmente, necesitar\xe1s:\n\n- Pasaporte v\xe1lido.\n- Certificado de antecedentes penales.\n- Prueba de solvencia econ\xf3mica o inversi\xf3n.\n- Domicilio en Panam\xe1.\n\n\u2705 2. Establecer el Centro de Intereses Econ\xf3micos o Personales en Panam\xe1\nLa Direcci\xf3n General de Ingresos (DGI) considera residente fiscal a quien:\nPermanece en Panam\xe1 m\xe1s de 183 d\xedas calendario (consecutivos o no) en un a\xf1o fiscal.\nTiene su centro de intereses econ\xf3micos o vitales en Panam\xe1 \n(por ejemplo, negocios, empleo o familia radicada all\xed).\n\n\u2705 3. Solicitar el Certificado de Residencia Fiscal ante la DGI\nUna vez tengas residencia legal y hayas cumplido con el tiempo o criterios necesarios, \npuedes solicitar el certificado fiscal.\n\nRequisitos comunes:\n\n- Copia del carn\xe9 de residente permanente.\n- Comprobante de direcci\xf3n (recibo de servicios, contrato de alquiler, etc.).\n- Evidencia de fuente de ingresos o actividad econ\xf3mica en Panam\xe1.\n- Pruebas de permanencia en el pa\xeds (sellos en el pasaporte, registros migratorios).\n- Formularios de la DGI y carta de solicitud.\n- La DGI evaluar\xe1 si realmente eres considerado residente fiscal de acuerdo con sus criterios.\n\n\u2705 4. Registrar Actividades Econ\xf3micas (si aplica)\n\nSi vas a operar un negocio o trabajar como independiente, deber\xe1s:\n\n- Obtener un Aviso de Operaci\xf3n Comercial.\n- Registrarte ante el Ministerio de Comercio e Industrias (MICI).\n- Obtener un RUC (Registro \xdanico de Contribuyentes) y declarar impuestos en Panam\xe1.\n\n\u2705 5. Consideraciones Adicionales\nConsulta con un abogado migratorio y fiscal paname\xf1o para preparar la documentaci\xf3n correctamente.\nPanam\xe1 no tiene impuesto sobre la renta mundial (solo se grava la renta de fuente paname\xf1a).",null,B.dV,B.cK,null,null,null,null,null)
B.wk=new A.a_("\ud83d\udc69\u200d\u2696\ufe0f 1. Multas y recargos\nLa Caja de Seguro Social (CSS) impone recargos por mora del 9\u202f% anual sobre saldos vencidos.\nAdem\xe1s, aplica una multa fija de hasta B/.500.00 por cada infracci\xf3n,\ndependiendo de la gravedad y reincidencia.\n\n\ud83e\uddfe 2. Deudas acumuladas y cobro coercitivo\nLas cuotas adeudadas se acumulan y se convierten en una deuda exigible.\nLa CSS puede iniciar un proceso de cobro judicial o administrativo, embargando:\nCuentas bancarias de la empresa\nVeh\xedculos o propiedades\nIngresos por contratos\n\n\ud83d\udeab 3. Suspensi\xf3n de Aviso de Operaci\xf3n\nSi no est\xe1s al d\xeda con la CSS, el Ministerio de Comercio e Industrias (MICI)\npuede suspender tu Aviso de Operaci\xf3n, impidi\xe9ndote seguir funcionando legalmente.\n\n\ud83c\udfe2 4. Impedimento para contratar con el Estado\nEmpresas que no est\xe9n al d\xeda con la CSS no pueden participar en licitaciones\np\xfablicas ni firmar contratos estatales.\n\n\u26a0\ufe0f 5. Responsabilidad personal del empleador\nSi eres empleador y no pagas las cuotas, podr\xedas ser personalmente responsable ante la ley por:\nRetener cuotas a los trabajadores y no remitirlas (delito)\nFraude laboral si falsificas planillas o pagas por fuera\n\n\ud83d\udeb7 6. Bloqueo para trabajadores independientes\nSi trabajas por cuenta propia y no pagas, no tendr\xe1s:\nAcceso a servicios m\xe9dicos de la CSS\nDerecho a pensi\xf3n, incapacidades, licencias por maternidad, etc.\nConstancia de paz y salvo laboral, que es requisito para ciertos tr\xe1mites\n\n\ud83d\udcc9 7. Afectaci\xf3n al historial financiero\nLas deudas con la CSS pueden afectar tu reputaci\xf3n empresarial y \nacceso a cr\xe9dito, especialmente si se publican en boletines oficiales o listas de morosos.",null,B.dV,null,null,null,null,null,null)
