B.PU=new A.a_("\u2022 CONFECCION DE ESCRITURAS P\xdaBLICAS.\n\u2022 ESCRITURAS DE DECLARACI\xd3N DE MEJORAS.\n\u2022 DONACIONES CON USUFRUCTO.\n\u2022 ASISTENCIA EN TR\xc1MITES DE MATRIMONIO A TRAV\xc9S DE NOTARIA(PANAME\xd1O-EXTRANJERO Y EXTRANGEROS CON EXTRANJEROS).\n\u2022 OTORGAMIENTO Y REVOCACI\xd3N DE PODERES.(PERSONA NATURAL Y JUR\xcdDICA).\n\u2022 EXONERACI\xd3N DE IMPUESTOS DE TRANSFERENCIA POR DONACI\xd3N ENTRE C\xd3NYUGES Y DE PADRES E HIJOS.\n\u2022 TESTAMENTOS Y HERENCIAS (SUCESIONES).\n\u2022 AUTENTICACIONES Y COTEJOS DE DOCUMENTOS.\n\u2022 APOSTILLAS Y LEGALIZACIONES DE DOCUMENTOS.\n\u2022 TRAMITACIONES DE PERSONER\xcdA JUR\xcdDICA PARA ASOCIACIONES SIN FINES DE LUCRO.\n\u2022 TRAMITACIONES DE IDONEIDAD PARA EL EJERCICIO DE PROFESIONES LIBERALES.\n\u2022 DECLARACI\xd3N JURADA.\n\u2022 PERMISO DE SALIDA DE MENOR.",null,null,null,null,null,null,null,null)
