B.wn=new A.a_("1. Elegir la estructura legal \ud83e\uddfe\nLas formas m\xe1s comunes son:\n\nSociedad An\xf3nima (S.A.): requiere m\xednimo de 3 directores; uso popular para empresas\ngrandes y con confidencialidad .\nSociedad de Responsabilidad Limitada (S.R.L.): ideal para PYMEs; m\xednimo 2 socios y un administrador .\nTambi\xe9n existen otros tipos como empresas unipersonales o fundaciones privadas .\n\n2. Reservar nombre y redactar estatutos\nVerifica disponibilidad del nombre en el Registro P\xfablico de Panam\xe1 (incluye \u201cS.A.\u201d o \u201cS.R.L.\u201d)\nRedacta los estatutos o art\xedculo de constituci\xf3n en espa\xf1ol, incluyendo: nombre,\nprop\xf3sito, capital autorizado (normalmente USD\u202f10\u202f000), directores, domicilio legal y agente residente\n\n3. Nombrar directores y agente residente\nEn S.A.: m\xednimo 3 directores (no necesitan ser residentes) .\nEn S.R.L.: uno o varios administradores.\nSe exige un agente residente (un abogado o firma legal paname\xf1a), \nQuien figura en los estatutos pero sin participaciones .\n\n4. Protocolizar ante notario y registrar\nLos estatutos deben ser notarizados y presentados en el Registro P\xfablico para inscripci\xf3n oficial.\nCuota aproximada: USD 300 (inscripci\xf3n y derechos)\nTiempo estimado: entre 5\u201315 d\xedas h\xe1biles para inscribir la empresa\n\n5. Obtener RUC (Registro \xdanico del Contribuyente)\nReg\xedstrate en la DGI para obtener el RUC, necesario para facturaci\xf3n y tributaci\xf3n .\n\n6. Tramitar el \u201cAviso de Operaci\xf3n\u201d o Licencia de Funcionamiento\nSolicita el Aviso de Operaci\xf3n en Panam\xe1 Emprende (MICI). Cuesta alrededor de USD\u202f55 .\nLuego, inscr\xedbelo ante la municipalidad correspondiente (MUPA)\n\n7. Registrar la empresa como empleador\nSi vas a contratar personal, reg\xedstrate ante la Caja de Seguro Social (CSS) .\n\n8. Abrir cuenta bancaria\nAunque no es obligatorio, es pr\xe1ctico abrir cuenta corporativa en banca local\n(Banco General, Banistmo, BAC, etc.)\nTe pedir\xe1n: acta constitutiva, poderes, pasaporte de directores, referencias bancarias y apostillas\n\n9. Obtener permisos adicionales\n\nSeg\xfan el giro de la empresa, puede requerirse:\nPermisos municipales o sectoriales (alimentaci\xf3n, salud, licor) .\nRegistro en AMPYME para empresas con inversi\xf3n < USD\u202f150\u202f000 (beneficios fiscales)\n\n10. Mantenimiento anual\n\nDebes renovaciones peri\xf3dicas:\n\nAgente residente, licencias, CSS, licencias.\nImpuesto anual (2\u202f% del patrimonio neto, entre USD\u202f100\u202fy USD\u202f60\u202f000).\nContador local para presentar informes al DGI y CSS",null,B.dV,null,null,null,null,null,null)
