B.Q2=new A.a_("  \u2022 MITRADEL:\n    - Permiso de trabajo todas las categorias.\n \u2022\tMUNICIPIO:\n    - inscripcion de negocio y cierre.\n    - Traspaso vehiculos y otros.\n \u2022\tDireccion general de ingresos:\n    - Prescripcion de impuestos.\n    - Inscripcion y cierre de sociedad y negocios.\n    - Reactivacion de sociedad y fundaciones de interes privado.\n    - Pago de taza unica y de otros impuestos Y otros\n \u2022\tCaja de Seguro Social:\n    - Sipe manejo de planilla.\n    - Presentacion planilla 03 DGI.\n    - Todo tipo de tramites en CSS.\n \u2022 Ministerio de salud:\n    - Registro sanitario(alimentos,bebidas,productos farmaceuticos,cosmeticos y fertilizantes.)\n \u2022 ANATI:\n    - Actualizacion de valor catastral y otros\n \u2022 Ministerio del comercio e industria:\n    - Registro de Marcas y Renovaci\xf3n de Marcas.\n    - Permisos y autorizaciones de registros para SEM, R\xe9gimen de Zonas Francas.\n    - Registro en Panam\xe1 Pac\xedfico y en la Autoridad de Turismo para incentivos fiscales y similares.\n    - Representaci\xf3n para interponer recursos dentro la Administraci\xf3n P\xfablica.\n    - Gestiones de Cobro y Factoring ante el Estado.",null,B.bJ,B.cK,null,null,null,null,null)
B.Q3=new A.a_("\u2022 Visas de no residentes: (turista, de tr\xe1nsito, trabajadores eventuales y dom\xe9sticos, otras.\n \u2022 Visas Permanentes:\n- Por razones econ\xf3micas: (inversi\xf3n, solvencia econ\xf3mica.\n- Por razones Especiales: (retirado, pensionado, call center, zonas francas.\n- Laborales: extranjeros contratados bajo el 10 y 15%.\n- Razones Demogr\xe1ficas: casado con nacional, hijos paname\xf1os.\n- Leyes especiales: por convenios entre pa\xedses, extranjeros profesionales y otros.\n- Razones Religiosas.\n\u2022\tPermisos para Residentes Temporales:\n- Razones laborales, de inversi\xf3n, de estudiante.\n\u2022\tPol\xedticas Especiales.\n\u2022\tReagrupaci\xf3n familiar para residentes permanentes y temporales.\n\u2022\tRegularizaci\xf3n Migratoria.\n- Renovaci\xf3n 6 a\xf1os y permanente.\n\u2022\tNATURALIZACI\xd3N.\n\u2022\tOtros: (Registro, traspaso, estatus migratorio, movimiento migratorio).\n\u2022\tLevantamiento de impedimentos, solicitud de certificaci\xf3n.",null,B.dU,null,null,null,null,null,null)
B.ww=new A.a_("\nEstablecer un nuevo domicilio tributario en Panam\xe1 implica registrar una direcci\xf3n\nfiscal ante la Direcci\xf3n General de Ingresos (DGI) del Ministerio de Econom\xeda y\nFinanzas (MEF), ya sea como persona natural o jur\xeddica. Esto es clave si deseas\ntributar en Panam\xe1 y obtener beneficios como la residencia fiscal o evitar la doble tributaci\xf3n,\nseg\xfan convenios internacionales.\n\n\u2705 \xbfQu\xe9 es el domicilio tributario en Panam\xe1?\n\nEs la direcci\xf3n oficial registrada ante la DGI donde se recibe notificaci\xf3n y \ncorresponde presentar declaraciones fiscales.\nGeneralmente, debe estar en el territorio paname\xf1o.\n\n\u2705 Pasos para Establecer un Nuevo Domicilio Tributario\n\n1. Constituye una Presencia Legal en Panam\xe1\n\nDependiendo de tu situaci\xf3n:\n\n- Como persona natural: Obt\xe9n una residencia legal (visa) o reg\xedstrate como contribuyente.\n- Como persona jur\xeddica (empresa): Constituye una sociedad o registra una sucursal.\n\n2. Inscr\xedbete ante la DGI\n\nPara esto necesitas:\n\n- Copia del pasaporte (o c\xe9dula si eres residente).\n- Direcci\xf3n f\xedsica en Panam\xe1 (no basta solo un apartado postal).\n- Documento que respalde el uso de la direcci\xf3n: contrato de alquiler,\n- recibo de servicios, o carta de residencia.\n- Formulario de inscripci\xf3n en el RUC (Registro \xdanico de Contribuyentes).\n\n3. Declara tu Nuevo Domicilio Tributario\n\nEsto se hace mediante:\n\n- El portal e-Tax 2.0 de la DGI: https://etax2.mef.gob.pa\nO presencialmente en una oficina regional de la DGI.\nSi ya ten\xedas un RUC y vas a cambiar tu domicilio, debes presentar una\nactualizaci\xf3n de datos del contribuyente.\n\n4. Solicita el Certificado de Residencia Fiscal (si lo necesitas)\nUna vez tengas el domicilio fiscal y cumplas con los criterios,\npuedes pedir este certificado para usar en convenios de doble tributaci\xf3n.\n\n\u2705 Recomendaciones\n\nUsa una direcci\xf3n real y activa en Panam\xe1. No se recomienda usar direcciones \nficticias o virtuales sin respaldo legal.\nSi eres extranjero, es altamente recomendable contar con el apoyo de un contador o \nabogado tributario paname\xf1o para este proceso.\nSi tu objetivo es cambiar tu residencia fiscal de otro pa\xeds a Panam\xe1,\naseg\xfarate de salir del sistema fiscal de tu pa\xeds actual correctamente.",null,B.dV,null,null,null,null,null,null)
B.wx=new A.a_("1.Residencia Permanente como Nacional de Pa\xedses Amigos\nIdeal si eres de pa\xedses como Espa\xf1a, Argentina, Chile, Colombia, EE.\u202fUU., M\xe9xico, Uruguay, etc.\n\nRequisitos:\nSer ciudadano de uno de los 50 pa\xedses amigos de Panam\xe1.\nTener v\xednculo laboral, inversi\xf3n o profesional en Panam\xe1:\nContrato de trabajo con empresa paname\xf1a\nInversi\xf3n en una empresa local (m\xednimo B/.10,000)\nCompra de propiedad (m\xednimo B/.200,000)\nCertificado de antecedentes penales y pasaporte vigente\n\nBeneficios:\nEs una residencia permanente directa.\nPuedes incluir dependientes (c\xf3nyuge, hijos).\n\n2. \ud83d\udcbc Visa de Inversionista\na) Inversionista Calificado\nInversi\xf3n de al menos B/.300,000 (USD 300,000) en bienes ra\xedces, bolsa o plazo fijo bancario.\nPermite obtener residencia permanente directamente.\nb) Solvencia Econ\xf3mica Propia\nInversi\xf3n de B/.300,000 en bienes ra\xedces y demostrar ingresos propios.\n\n3. \ud83d\udc68\u200d\ud83d\udc69\u200d\ud83d\udc67\u200d\ud83d\udc66 Residencia por Razones Familiares\n\nPuedes aplicar si tienes:\n\nC\xf3nyuge paname\xf1o\nHijos paname\xf1os menores de edad o dependientes\nPadres paname\xf1os\n\nRequisitos:\nCertificado de matrimonio, nacimiento, etc.\nComprobante de sustento econ\xf3mico\n\n4. \ud83d\udcda Visa de Estudiante\nPara personas que deseen estudiar en universidades o escuelas paname\xf1as.\nDuraci\xf3n: Residencia temporal renovable mientras duren los estudios.\n\n5. \ud83e\uddd3 Visa de Jubilado o Pensionado\nPara extranjeros que reciben una pensi\xf3n vitalicia m\xednima de USD 1,000 mensuales.\n\nBeneficios:\nResidencia permanente\nExenciones fiscales, descuentos (farmacias, viajes, etc.)\n\n6. \ud83c\udfe2 Visa de Trabajo o Permiso Laboral\nContrato de trabajo con empresa paname\xf1a + permiso laboral.\nResidencia temporal renovable, luego puedes aplicar a permanente.\n\ud83d\udcdd PASOS GENERALES PARA TRAMITAR LA RESIDENCIA\n\nRe\xfane la documentaci\xf3n requerida:\nPasaporte vigente\nAntecedentes penales apostillados\nCertificados de ingresos o inversiones\nFotograf\xedas, formularios y pagos\nContrata un abogado local (obligatorio en la mayor\xeda de tr\xe1mites migratorios en Panam\xe1).\nPresenta la solicitud ante el Servicio Nacional de Migraci\xf3n (SNM).\nRecibe la residencia provisional (6\u201312 meses).\nRecibe la residencia permanente (si aplica al tipo de visa).\nC\xe9dula E (identificaci\xf3n paname\xf1a para extranjeros con residencia).\n\u23f3 TIEMPOS APROXIMADOS\nTipo de Residencia\tTiempo estimado\nPa\xedses Amigos\t2\u20136 meses\nInversionista Calificado\t30 d\xedas\nJubilado o Pensionado\t2\u20134 meses\nTrabajo o Familiar\t4\u20138 meses",null,B.dV,null,null,null,null,null,null)
